import { useEffect } from "react";

const DashboardRestoranti = () => {
    useEffect(()=>{
        async () => {
            await fetch(process.env.REACT_APP_API+'authmanagement/user',{
                method:'Get',
                headers:{
                    'Accept':'application/json',
                    'Content-Type':'application/json'
                },
                credentials: 'include',
                body:JSON.stringify({
                    email,
                    password
                })
            })
            .then(res=>res.json())
            .then((result)=>{
                console.log(result);
            },
            (error)=>{
                alert('Failed');
            })
    
        }
    })
    return ( 
        <div>
            <h1>Miresevini Restoranti: ...</h1>
        </div>
     );
}
 
export default DashboardRestoranti;
